@irina balaskova , посыл то возможно и правильный, да вот он сильно подорвёт отношение запада к нам, в особенности Польши, стран Прибалтики и Финляндии. Как по мне уж лучше сказать один раз, что мы осуждаем действия советских властей в тот период и забыть об этом, начав строить новые отношения основанные на взаимовыгодных вещах по типу транзита газа и всего прочего, чем только разогревать накал страстей такими вот статьями. 
И ладно бы, если бы её опубликовали только у нас, но её сразу специально издали для запада, на показ выставляя то, что мы считаем войну с Финляндией, присоединение (ну или оккупацию, освобождение. Называйте как хотите-результат один.) восточной Польши, создание из Польши марионетки после войны и захват Прибалтики вполне обоснованными и справедливыми, да и вообще, они сами просили, чтоб мы их к себе приняли!
Это очень глупо, современные международные отношения базируются на торговле и взаимовыгодных инвестициях, которая связывает страны и заставляет их сотрудничать не смотря на разногласия в территориях и в режимах. А мы до сих пор стараемся находить союзников с помощью сильного войска и исторической правды!

