@кайрат жакан   Сталин не был просто умным человеком. Сегодня понимаешь, что он был ВЕЛИКИМ ЧЕЛОВЕКОМ. Только Великий человек мог сделать то, что сделал за короткий срок из России с сохой Сталин. 
Он не просто сохранил страну и обеспечил жизнь каждому из нас, в том числе тем уродам и недоумкам, кто клянет его за то, что Сталин сохранил жизнь его предкам, которых уничтожить собирался Гитлер. Никто из его хулителей ни разу не назвал способов, какими они сделали бы страну лучше него. Я родился в год его смерти, но ещё в детстве понимал, что это несправедливо, что его , кто организовал победу, стали обвинять во всём. Хотя и понимал справедливость некоторых обвинений. Но только  лет десять назад я понял все его величие. Как и понял то, к чему привел призыв к покаянию. Именно  фильмом Абуладзе Покаяние был дан приказ к штурму СССР. Нас снова зовут к покаянию фильмами типа
Зулейхи. Не все в нас советское уничтожено. Именно на этом пока жива Россия. Вопреки твоим желаниям.

