//их ненависть к Советскому Союзу, Советской власти и социализму//
Предлагал, и продолжаю предлагать, Сталинских большевиков и Сталинских коммунистов, которые идейно были социалистами, как и сам тов. Сталин, именовать большевиками, социалистами, социал-большевиками, НО НЕ коммунистами, потому как, своей работой - "О построении социализма в отдельной стране", Тов. Сталин идейно завершил коммуно-троцкисткий проект, развеял "Призрак коммунизма" бродивший по Европе, и за большие деньги, набежавший на РИ.
Что успел тов. Сталин, то это распустить "коминтерн", что не успел, то это, избавиться от слова "коммунистическая".
Отдаляя партию от управления страной, отдалив её полностью, оставив ей только теоретические вопросы развития социализма, до удаления этого слова из названия, оставалось года три. Троцкисты опередили, отравили Вождя, и коммунистические бредни полились с новой силой.

